you will find your application and admission status by signing in to one.sjsu.edu and searching for the mysjsu tile to access your mysjsu account. please scroll to the bottom of your mysjsu student center to view your admission status. this is the first status applicants see upon submitting a cal state apply application. your application is waiting to be processed; we appreciate your patience. please sign in to one.sjsu.edu and check your mysjsu to do list frequently for new items such as transcripts and test scores needed to complete your application. you will have an opportunity to complete your file/application for admission review once to do list items are posted to your account. it is recommended that you check mysjsu on a weekly basis for new messages and updates to your application status and to do list. [nc] your application is not complete and is in the process of being verified for required documents. please sign in to one.sjsu.edu and check your mysjsu to do list frequently for items such as transcripts and documents needed to complete your application. to submit your transcripts and documents, follow the instructions listed on your mysjsu to do list. [nc] your application remains incomplete but has been verified by admission services personnel for documents needed to continue processing your application. please take action now and sign in to one.sjsu.edu and review your mysjsu to do list for items required immediately. [ncv] your application has been received and is pending review of csu eligibility requirements. we anticipate completing csu eligibility review by january for fall applicants and october for spring applicants. the review for csu eligibility takes place prior to the review of your application for provisional admission according to current impaction criteria. it is imperative that you continue to monitor your mysjsu account frequently for any changes to your admission status, including any additional requests for documents, to do list items,