o complete your admission process. in the to do list section of your mysjsu account you will see this message: "no to dos." [cc] you have been admitted in a clear status with honors at entrance and do not owe any documents to complete your admission process. [cchn] you are a returning student and have been readmitted on probation. [ccpb] you have been admitted provisionally. you will continue to see incomplete to do list items on your student center page as long as you owe final documents to complete your admission process. check your mysjsu to do list for detailed instructions. you must also meet the csu requirements for eligibility for the class level to which you were admitted. this is true for all new and returning students and is especially true of upper-division transfers who must complete a minimum of 60 transferable semester units (90 quarter units) prior to enrolling. [pr] you have been admitted provisionally. your admission is subject to final verification of final transcripts of the following: you must also complete all of the terms and conditions of your admission by meeting the intent to enroll deadline, submitting documents and meeting final admission and impaction requirements. you will continue to see incomplete to do list items on your student center page as long as you owe final documents to complete your admission process. check your mysjsu to do list for detailed instructions. [prs] your admission was deferred from the fall term to the spring term. you have been provisionally admitted. you will continue to see incomplete to do list items on your student center page as long as you owe final documents to complete your admission process. check your mysjsu to do list for detailed instructions. [prd] you have been admitted provisionally pending verification of the following: submit your transcripts showing successful completion of the requirements listed above to verify your eligibility for admission. once this information is verified as completed, sjsu will change your status to . if you have been provisionally admitted, then you will continue to see incomplete to do list items on your student center page as long as you owe final documents to complete your admission process. check your mysjsu to do list for detailed instructions. if you have a clear admit status, you will see this message in the to do list section of your mysjsu account: "no to dos." [apv or iapv] you have been conditionally admitted (frosh) based on the self-reported information that you provided in your application. conditional admission is subject to final verification of final transcripts of the following: you must also complete all of the terms and conditions of your admission by meeting the intent to enroll deadline, submitting documents and meeting final admission and impaction requirements.  please check your to do list items on mysjsu for requests for a transcript from your high school to verify your eligibility for admission. once this information is verified, sjsu will change your status to clear admit. [aaf/aafc] you have been conditionally admitted (transfer) based on the self-reported information you provided on your application as well as the sjsu supplemental application. because of this, your registration is withheld, pending the verification of: submit your official transcripts showing coursework completed through the spring term for a fall admission term, and the fall term for a spring admission term to verify your eligibility for admission. once your transcripts are received, sjsu will change your status to allow you to register. if your status is provisionally admitted you have been admitted provisionally and owe final documents to complete your admission process. check your to do list at mysjsu for instructions. if your status is clear admit, under your to do list at mysjsu you will see this message: "no to dos." [aat|aatc]   your application is under review. continue to monitor mysjsu for requests for information, messages, and the progress of your application status. [rfug] your application is under review. continue to monitor mysjsu for requests for information, messages, and the progress of your application status. [rfpb]   based on self-reported information from the cal state apply application as well as the supplemental application (transfer only) the applicant does not meet the minimum csu eligibility requirements. [dcsu] after final verification of official transcripts and application materials, your admission has been canceled because you do not meet the admission eligibility standards required for csu admission. please refer to the letter that was sent to you via email. [deny] due to enrollment restrictions and space availability, the application has been withdrawn and may be eligible for redirection if the applicant was not admitted to any california state university for the given term. non residents of california and international applicants are not eligible for redirection. [wred or wdun] due to enrollment restrictions and space availability, the non-resident or international applicant has been withdrawn due to not meeting impaction. [wdnr]   the applicant does not have 60 transferable units. [wdun] the application has been withdrawn because the freshman applicant has earned college credit beyond the summer immediately following high school graduation, which means the student is a lower-division transfer applicant. sjsu does not accept applications from domestic lower-division transfer applicants. [wldt] the application has been withdrawn. [wd] on final verification of documents, the application has been withdrawn for failure to meet the impaction standard for the program (major). [wdni] the application has been withdrawn because the applicant failed to meet one or more deadlines. [ddln] the application has been withdrawn because the applicant failed to meet one or more deadlines or a provision of your admission. [dnmd] your admission has been withdrawn because you faile